import React from "react";
import styled from "styled-components";

const Main = ({ title }) => {
  return (
    <Wrapper>
      <SubHeader>{title}</SubHeader>
    </Wrapper>
  );
};

export default Main;

const Wrapper = styled.main`
  width: 100vw;
  position: relative;
`;

const SubHeader = styled.h2``;
